  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a detailed summary
  of the baseline wilderness character assessment completed for the Medicine Lake
  National Wildlife Refuge Wilderness, located in Montana. The purpose of this report
  is multi-dimensional. It establishes a wilderness character monitoring program for
  the Medicine Lake Wilderness and provides baseline data for future trend analysis.
  An understanding of the information in this report may also aid resource specialists
  by informing management decisions within the Medicine Lake Wilderness. Finally,
  this report is meant to accompany and explain the quantitative results of Medicine
  Lake wilderness character assessment that have been entered into a national wilderness
  character monitoring database.  A total of 30 measures were used to assess the following:
  untrammeled quality, natural quality, undeveloped quality, and solitude or primitive
  and unconfined recreation quality.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
